import React from 'react';
import styled, { keyframes } from 'styled-components';
import { motion } from 'framer-motion';
import { FaHeadset, FaRobot, FaBrain, FaLightbulb } from 'react-icons/fa';

// Continuous rotation animation
const rotate = keyframes`
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
`;

// Floating animation
const float = keyframes`
  0%, 100% {
    transform: translateY(0px) scale(1);
  }
  50% {
    transform: translateY(-8px) scale(1.05);
  }
`;

// Pulse animation for the glow
const pulse = keyframes`
  0%, 100% {
    box-shadow: 0 4px 20px rgba(14, 165, 233, 0.4);
  }
  50% {
    box-shadow: 0 6px 30px rgba(14, 165, 233, 0.8);
  }
`;

// Color shifting animation
const colorShift = keyframes`
  0% {
    background: linear-gradient(135deg, #0ea5e9, #3b82f6);
  }
  25% {
    background: linear-gradient(135deg, #10b981, #059669);
  }
  50% {
    background: linear-gradient(135deg, #8b5cf6, #7c3aed);
  }
  75% {
    background: linear-gradient(135deg, #f59e0b, #d97706);
  }
  100% {
    background: linear-gradient(135deg, #0ea5e9, #3b82f6);
  }
`;

const LogoContainer = styled(motion.div)`
  position: relative;
  display: flex;
  align-items: center;
  gap: 0.75rem;
`;

const AnimatedLogoIcon = styled.div`
  width: 50px;
  height: 50px;
  border-radius: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  overflow: hidden;
  animation: ${float} 3s ease-in-out infinite, ${pulse} 2s ease-in-out infinite;
  background: linear-gradient(135deg, #0ea5e9, #3b82f6);
  
  &::before {
    content: '';
    position: absolute;
    top: -2px;
    left: -2px;
    right: -2px;
    bottom: -2px;
    background: ${colorShift} 8s ease-in-out infinite;
    border-radius: 17px;
    z-index: -1;
  }
  
  &::after {
    content: '';
    position: absolute;
    top: 2px;
    left: 2px;
    right: 2px;
    bottom: 2px;
    background: linear-gradient(135deg, #0ea5e9, #3b82f6);
    border-radius: 13px;
    z-index: 0;
  }
`;

const IconWrapper = styled.div`
  position: relative;
  z-index: 1;
  color: white;
  font-size: 1.4rem;
  animation: ${rotate} 8s linear infinite;
`;

const OrbitingIcons = styled.div`
  position: absolute;
  width: 80px;
  height: 80px;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  pointer-events: none;
`;

const OrbitIcon = styled.div`
  position: absolute;
  width: 16px;
  height: 16px;
  color: rgba(255, 255, 255, 0.6);
  font-size: 12px;
  display: flex;
  align-items: center;
  justify-content: center;
  
  &:nth-child(1) {
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    animation: ${rotate} 12s linear infinite;
  }
  
  &:nth-child(2) {
    top: 50%;
    right: 0;
    transform: translateY(-50%);
    animation: ${rotate} 15s linear infinite reverse;
  }
  
  &:nth-child(3) {
    bottom: 0;
    left: 50%;
    transform: translateX(-50%);
    animation: ${rotate} 10s linear infinite;
  }
  
  &:nth-child(4) {
    top: 50%;
    left: 0;
    transform: translateY(-50%);
    animation: ${rotate} 18s linear infinite reverse;
  }
`;

const LogoText = styled.div`
  h1 {
    font-size: 1.8rem;
    font-weight: 700;
    color: #ffffff;
    margin: 0;
    text-shadow: 0 0 30px rgba(0, 212, 255, 0.5), 0 2px 4px rgba(0, 0, 0, 0.8);
    background: linear-gradient(135deg, #ffffff, #e0f2fe, #b3e5fc);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    background-clip: text;
    position: relative;
    z-index: 10;
    
    &::after {
      content: '';
      display: inline-block;
      width: 8px;
      height: 8px;
      background: linear-gradient(135deg, #10b981, #059669);
      border-radius: 50%;
      margin-left: 8px;
      animation: ${pulse} 1.5s ease-in-out infinite;
    }
  }
  
  p {
    font-size: 0.875rem;
    color: #e0e7ff;
    margin: 0;
    font-weight: 500;
    opacity: 0.9;
    text-shadow: 0 1px 2px rgba(0, 0, 0, 0.8);
    animation: ${float} 4s ease-in-out infinite;
    animation-delay: 0.5s;
    position: relative;
    z-index: 10;
  }
`;

const Sparkle = styled.div`
  position: absolute;
  width: 4px;
  height: 4px;
  background: white;
  border-radius: 50%;
  opacity: 0;
  animation: sparkle 3s ease-in-out infinite;
  animation-delay: ${props => props.delay}s;
  
  @keyframes sparkle {
    0%, 100% {
      opacity: 0;
      transform: scale(0);
    }
    50% {
      opacity: 1;
      transform: scale(1);
    }
  }
  
  &:nth-child(1) { top: 10%; left: 20%; }
  &:nth-child(2) { top: 80%; right: 15%; }
  &:nth-child(3) { bottom: 20%; left: 10%; }
  &:nth-child(4) { top: 30%; right: 25%; }
`;

function AnimatedLogo() {
  return (
    <LogoContainer
      initial={{ opacity: 0, x: -50 }}
      animate={{ opacity: 1, x: 0 }}
      transition={{ duration: 1, ease: "easeOut" }}
    >
      <AnimatedLogoIcon>
        {/* Sparkling effects */}
        <Sparkle delay={0} />
        <Sparkle delay={1} />
        <Sparkle delay={2} />
        <Sparkle delay={0.5} />
        
        {/* Main rotating icon */}
        <IconWrapper>
          <FaHeadset />
        </IconWrapper>
        
        {/* Orbiting mini icons */}
        <OrbitingIcons>
          <OrbitIcon>
            <FaBrain />
          </OrbitIcon>
          <OrbitIcon>
            <FaRobot />
          </OrbitIcon>
          <OrbitIcon>
            <FaLightbulb />
          </OrbitIcon>
          <OrbitIcon>
            <FaHeadset />
          </OrbitIcon>
        </OrbitingIcons>
      </AnimatedLogoIcon>
      
      <LogoText>
        <motion.h1
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.3 }}
        >
          TriageAI
        </motion.h1>
        <motion.p
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.5 }}
        >
          AI-Powered Support
        </motion.p>
      </LogoText>
    </LogoContainer>
  );
}

export default AnimatedLogo;
